// src/App.js
import React from "react";
import "./App.css";
import SystemConfig from "./components/SystemConfig";
import StationList from "./components/StationList";
import VehicleList from "./components/VehicleList";

function App() {
	return (
		<div className="App">
			<SystemConfig />
			<StationList />
			<VehicleList />
		</div>
	);
}

export default App;
